import React,{useState} from "react";

function App() {

const [item,setItem]=useState({
  items:""
});

function handleChange(event){
  const{name,value}=event.target;
  setItem(preValue =>{
    return{
      ...preValue,
      [name]:value
    };
 });
}
function handleClick(){
itemse=item;
}


  return (
    <div className="container">
      <div className="heading">
        <h1>To-Do List</h1>
      </div>
      <div className="form">
        <input
        onChange={handleChange}
        value={item.items}
        name="items"
         type="text" />
        <button onClick={handleClick}>
          <span>Add</span>
        </button>
      </div>
      <div>
        <ul>
          <li>A Item </li>
          <li>{itemse}</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
